import React from 'react';
import {Badge, ListGroup} from "react-bootstrap";

const OrderItem = ({order}) => {
    return (
        <div className="p-2 m-1 d-flex justify-content-between">

                <ListGroup >
                    <ListGroup.Item className="d-flex justify-content-between" style={{width:500}} action variant="warning">
                        {order.client_name}
                        {order.client_name}
                    </ListGroup.Item>

                </ListGroup>

        </div>
    );
};

export default OrderItem;
